import './App.css';
import Header from './components/Header.js'
import item from './components/item.js'
import home from './assests/1.jpg'
import services from './assests/services.jpg'
import aboutus from './assests/aboutusus.jpg'
import contactus from './assests/contactus.jpg'

function App() {
  return (
    <div className="App">
      <Header />
      <div className="app__itemsContainer">
        <item 
          title = 'Wax on Wax Off'
          desc = 'Money back guarantee'
          desclink = ''
          backgroundImg = {home}
          leftbtnTxt = 'Quote Now'
          leftbtnLink = ''
          righttbtnTxt = 'Learn More'
          righttbtnLink = ''
          twoButtons = 'true'
          // first


        />

      </div>
    </div>

  );
}

export default App;
